import React from "react";
import "./App.css";
import { NavLink, Switch, Route } from "react-router-dom";

const App = () => (
  <div className="app">
    <Navigation />
    <Main />
  </div>
);
const Navigation = () => (
  <nav>
    <ul>

      <li>
        <NavLink exact activeClassName="current" to="/app/introduction">
          Introduction
        </NavLink>
      </li>
      <li>
        <NavLink exact activeClassName="current" to="/app/claim">
          Claim
        </NavLink>
      </li>

      <li>
        <NavLink exact activeClassName="current" to="/app/contact">
          Contact
        </NavLink>
      </li>
    </ul>
  </nav>
);

const Home = () => (
  <div className="home">
    <h1> </h1>
    <p>
      {" "}
      Welcome to ez-claim!
      Please choose the following service.
    </p>
  </div>
);

const Claim = () => (
  <div className="claim">
    <p>View your past invoices</p>
    <p>Add past invoices</p>
  </div>
);

const Contact = () => (
  <div className="contact">
    <p>Support page. we can add a ticketing system in the future.</p>
  </div>
);

const Main = () => (
  <Switch>
    <Route exact path="/app" component={Home} />
    <Route exact path="/app/claim" component={Claim} />
    <Route exact path="/app/contact" component={Contact} />
  </Switch>
);

export default App;
